import './ElementCont.css'

function ElementCont(props){
    return (
        <div id="ElementCont" style={{
            backgroundColor: (props.color ? props.color : '#FFFFFF')
        }}>
            <div id="contTitle" style={{
                backgroundColor: (props.color ? props.color : '#52CCBE80')
            }}>{props.title}</div>
            {props.children}
            <div id="stats">Comparisons: {props.stats}</div>
        </div>
    )
}

export default ElementCont
